		/// </remarks>
		private void MAHNB02342P_01A4C_ReportStart(object sender, System.EventArgs eArgs)
		{
            // 条件取得
            this._extraInfo = (ExtrInfo_MAHNB02347E)this._printInfo.jyoken;

			// 印刷件数初期化
			this._printCount = 0;
			
			// 罫線表示・非表示制御
			foreach (Section section in this.Sections)
			{
				Section targetSection = section; 
				//this.SetVisibleRuledLine(ref targetSection);
			}
            
            // グループ順制御
            this.ChangeGroupOrder();

            // 金額／消費税の表示
            this.ChangeSalesGoodsCd();

            // 小計印字制御
            this.ChangeSumRec();

            // 原価・粗利出力制御
            this.ChangeCostPrt();

            // 粗利チェックが入力されていなかったら出力しない処理
            //if (this._extraInfo.CostOut == 1)
            //{
            //    if((this._extraInfo.GrsProfitCheckLower == 0)&&(this._extraInfo.GrsProfitCheckLower == 0)&&(this._extraInfo.GrsProfitCheckUpper == 0))
            //    {
            //        Label_GrossMarginRate.Visible = false;
            //        Label_Percentage.Visible = false;
            //        GrossMarginMarkSlip.Visible = false;

            //        GrossMarginRate.Visible = false;

            //    }
            //}

            // 2008.11.28 30413 犬飼 改頁制御の変更 >>>>>>START
            // 2008.07.17 30413 犬飼 改頁制御の追加 >>>>>>START
            // 改頁設定
            if (this._extraInfo.NewPageType == 0)
            {
                // 拠点毎
                this.SectionHeader.NewPage = NewPage.Before;

                this.Header1.NewPage = NewPage.None;
                this.Header2.NewPage = NewPage.None;
                this.Header3.NewPage = NewPage.None;
            }
            else if (this._extraInfo.NewPageType == 1)
            {
                // 小計毎
                //this.SectionHeader.NewPage = NewPage.Before;

                //this.Header1.NewPage = NewPage.Before;
                //this.Header2.NewPage = NewPage.Before;
                //this.Header3.NewPage = NewPage.Before;

                switch (this._extraInfo.SortOrder)
                {
                    case 0:  // 売上日+伝票番号
                    case 2:  // 入力日+伝票番号
                    case 7:  // 伝票番号    // ADD 2009/06/12
                        {
                            this.SectionHeader.NewPage = NewPage.None;

                            this.Header1.NewPage = NewPage.None;
                            this.Header2.NewPage = NewPage.None;
                            this.Header3.NewPage = NewPage.None;
                            break;
                        }
                    case 1:  // 得意先+売上日+伝票番号
                    case 3:  // 得意先+入力日+伝票番号
                        {
                            this.SectionHeader.NewPage = NewPage.Before;

                            this.Header1.NewPage = NewPage.Before;
                            this.Header2.NewPage = NewPage.None;
                            this.Header3.NewPage = NewPage.None;
                            break;
                        }
                    case 4:  // 担当者+伝票番号
                    case 5:  // 地区+伝票番号
                    case 6:  // 業種+伝票番号
                        {
                            this.SectionHeader.NewPage = NewPage.Before;

                            this.Header1.NewPage = NewPage.Before;
                            this.Header2.NewPage = NewPage.None;
                            this.Header3.NewPage = NewPage.None;
                            break;
                        }
                }
            }
            else
            {
                // 改ページしない
                this.SectionHeader.NewPage = NewPage.None;

                this.Header1.NewPage = NewPage.None;
                this.Header2.NewPage = NewPage.None;
                this.Header3.NewPage = NewPage.None;
            }
            // 2008.07.17 30413 犬飼 改頁制御の追加 <<<<<<END
            // 2008.11.28 30413 犬飼 改頁制御の変更 <<<<<<END

            //----- ADD 2013/01/04 田建委 Redmine#34098 ----->>>>>
            // 罫線印字『印字する』の場合
            if (this._extraInfo.LinePrintDiv == 0)
            {
                this.line3.Visible = false;
                this.line11.Visible = true;
                this.Line48.Visible = true;
                this.line51.Visible = true;
                this.line52.Visible = true;
                this.line53.Visible = true;
                this.Line2.Visible = true;
                this.Line43.Visible = true;
                // --- ADD START 3H 尹安 2020/02/27 ----->>>>>
                this.line4.Visible = true;
                this.line5.Visible = true;
                this.line6.Visible = true;
                this.line7.Visible = true;
                this.line8.Visible = true;
                // --- ADD END 3H 尹安 2020/02/27 -----<<<<<
            }
            // 罫線印字『印字しない』の場合
            else
            {
                this.line3.Visible = true;
                this.line11.Visible = false;
                this.Line48.Visible = false;
                this.line51.Visible = false;
                this.line52.Visible = false;
                this.line53.Visible = false;
                this.Line2.Visible = false;
                this.Line43.Visible = false;
                // --- ADD START 3H 尹安 2020/02/27 ----->>>>>
                this.line4.Visible = false;
                this.line5.Visible = false;
                this.line6.Visible = false;
                this.line7.Visible = false;
                this.line8.Visible = false;
                // --- ADD END 3H 尹安 2020/02/27 -----<<<<<
            }
            //----- ADD 2013/01/04 田建委 Redmine#34098 -----<<<<<
            // --- ADD START 3H 尹安 2020/02/27 ----->>>>>
            // 税率別情報印字しないの場合、
            if (this._extraInfo.TaxPrintDiv == 1)
            {
                this.label1.Visible = false;
            }
            else
            {
                this.label1.Visible = true;
            }
            // --- ADD END 3H 尹安 2020/02/27 ----->>>>>

            
        }

