            // 売上の粗利率を設定
            grossMarginRate = this.Section_SalesGrossMarginRate.Text;
            grossMarginMark = this.Section_SalesGrossMarginMark.Text;
            // 粗利率設定
            SetGrossMargin(this.Section_TotalMeter.Text, this.Section_SalesCost.Text, ref grossMarginRate, ref grossMarginMark);
