            SetGrossMargin(this.Section_SalesTotalTaxExc.Text, this.Section_TotalCost.Text, ref grossMarginRate, ref grossMarginMark);
            // 2009.01.20 30413 犬飼 純売上の粗利率計算を修正 <<<<<<END
            this.Section_TotalGrossMarginRate.Text = grossMarginRate;
